  const [loadedPlaces, setLoadedPlaces] = useState(2);
  const { isLoading, sendRequest } = useHttpClient();

  const userId = useParams().userId;

  useEffect(() => {
    console.log(userId);
    const fetchPlaces = async () => {
      try {
        const responseData = await sendRequest(
          `http://localhost:5500/api/cars/user/64c2c41a544f64a59c40f18d`
        );
        setLoadedPlaces(responseData.cars);
        console.log(loadedPlaces);
      } catch (err) {
        console.log(err);
      }
    };
